import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the cart element
    // Using a selector that combines the class and visible text for robustness
    const cartElement = page.locator('div.cart:has-text("Cart")');
    await cartElement.waitFor({ state: 'visible', timeout: 5000 });
    await cartElement.click();

    // Wait for the cart modal to become visible
    // The provided JS code indicates the modal has an ID of 'cartModal'
    const cartModal = page.locator('#cartModal');
    await cartModal.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot with the modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract data to verify the modal is open
    const isModalVisible = await cartModal.isVisible();
    const modalHeaderText = await page.locator('#cartModal h2').textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        isModalVisible: isModalVisible,
        modalHeaderText: modalHeaderText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
      screenshots.push(path.join(screenshotsDir, 'error.png'));
    } catch (e) {
      // Ignore screenshot error if page is not available
    }
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
